sourcesContent:
import styled from 'styled-components';

export const ResumeFrame = styled.div`

    margin-top: 95px;
    display: flex;
    justify-content: center;
    width 90%;

`;

export const ResumeButton = styled.div`

    border: 4px solid #BA0D6B;
    width: 40%;

    margin: 20px 0;

    cursor: pointer;
`;


export const ResumeButtonText = styled.h6`

    margin: 37px 0;

    font-family: Lora;
    font-style: normal;
    font-weight: normal;
    font-size: 48px;
    line-height: 61px;
    text-align: center;
    letter-spacing: 4px;
    color: #BA0D6B;


`;
